          {/* <Switch> */}
        <main className={"main"}>
            <VideoList />
            {/* <Route component={VideoList} path="media_brouser_local_public/video/list/" exact />
            <Route component={ImgSinglePage} path="/img/single/" exact />
            <Route component={ImgGalleryPage} path="/img/gallery/" exact /> */}
        </main>
          {/* </Switch> */}
        {/* <Footer /> */}

    </div>
          {/* </BrowserRouter> */}
  </Provider>
)

export default App
